var state;
const countryData = ()=>{
    fetch("https://restcountries.com/v3.1/all")
        .then((res) => res.json())
            .then((json) => {
                state={
                    items: json,
                    DataisLoaded: true
                };
            })
    return (state);
}

export default countryData;
